import React from 'react';


const LastPlayDetail = (data) => {
    const instance = data.props;
    console.log('last play');
    console.log(instance);
    return (
        <div className="tabcontent">
            <h1>Last Play</h1>
            <ul>
                <li>{instance.clock}</li>
                <li>{instance.teamID}</li>
                <li>{instance.playerID}</li>
                <li>{instance.eventType}</li>
                <li>{instance.event}</li>
                <li>{instance.description}</li>
            </ul>
        </div>
    )
}

export default LastPlayDetail;
